function checkAndInjectTailwind(){let e=Array.from(parent.document.scripts).some(e=>e.src&&e.src.includes("tailwind"));if(!e){let t=document.createElement("script");t.src="https://cdn.tailwindcss.com",parent.document.head.appendChild(t),setTimeout(()=>{parent.tailwind.config={important:!0,theme:{extend:{}}}},250)}}function removeUnwantedMargin(){let e=window.frameElement.parentNode;e.style.display="none",e.style.width="unset",e.style.height="unset"}function addClassesToElement(){let e=[...parent.document.querySelectorAll("%SELECTOR%")]["%POS%"];if(null==e);else{let t="%CLASSES%".split(" ");e.classList.add(...t)}}setTimeout(()=>{removeUnwantedMargin(),checkAndInjectTailwind(),addClassesToElement()},350);
